import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link } from "react-router-dom";
import ProfileImage from "./ProfileImage";
import SideBar from "./SideBar";
import Brightness1Icon from "@mui/icons-material/Brightness1";
export default function HomePageMenu() {
  return (
    <div style={{ paddingLeft: "15%", paddingRight: "15%" }}>
      <div className="row mt-5">
        <div className="col-7" style={{ textAlign: "left", marginLeft: "4%" }}>
          <h2 style={{ color: "white", fontSize: "60px" }}>Omer Perez</h2>
          <h4 style={{ color: "#cccccc" }}>Junior Full Stack Developer</h4>
          <br />
          <div style={{ textAlign: "left", color: "#cccccc" }}>
            More than 4 years of managing technological teams that provide
            infrastructure and support to software teams field as part of my
            service as a captain (officer) in both MAMRAM and 8200 units in the
            IDF.
            <br style={{ height: "12px" }} />
            <br />
            3rd year B.Sc. in Computer Science in The College of Management
            Academic Studies, seeks real-world experience as Full Stack. Offers
            strong interpersonal and task prioritization skills.
            <br />
            <br />
            Good high leading skills, with assertive personality, a team player,
            problems solver, Can Do attitude, and excellent self-learning
            skills.
          </div>
        </div>
        <div className="col-3 offset-1">
          <img
            style={{
              width: "350px",
              height: "250px",
              boxShadow:
                "0 10px 20px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)",
            }}
            src="../Images/CoverImage.jpg"
          />
        </div>
      </div>
    </div>
  );
}
